INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (6686,'MOD_GRID_ABOUT_US_CONTENT','<div style=\'color: #555; line-height: 18px; font-size: 12px; padding: 20px 0 0\'><p><strong>Author:</strong></p>Grid GK5 is a product of <a href=\'http://www.gavick.com\' target=\'_blank\' style=\'color: #2f4c6d\'>GavickPro</a>.  Our company objective since 2007 has been to produce and release professional, effective and leading-edge <a href=\'http://www.gavick.com/products/templates.html\' target=\'_blank\' style=\'color: #2f4c6d\'>Joomla Templates</a> in response to the needs of website developers.  Additionally, we provide <a href=\'http://www.gavick.com/best-free-joomla-tab-module.html\' target=\'_blank\' style=\'color: #2f4c6d\'>free extensions</a> and modules, and we constantly update <a href=\'http://www.gavick.com/magazine/\' target=\'_blank\' style=\'color: #2f4c6d\'>Gavick Magazine</a>, our online journal which provides breaking industry news and tips you can use to be more effective and to avoid possible issues.<p style=\'font-size: 11px; text-align: center;margin: 60px -10px 0; border-top: 1px solid #eee; padding: 6px 0\'>Grid GK5 is released under the <a href=\'http://www.gnu.org/licenses/gpl-2.0.html\' target=\'_blank\' style=\'color: #2f4c6d\'>GNU/GPL v2 license.</a></p>','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_grid_gk5.ini');
