INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (6779,'MOD_JGTREEVIEW_DESC','Module JoomTreeview for the Joomla! component JoomGallery','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_jgtreeview.sys.ini');
