INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (7611,'K2_MENU_TO_RENDER_DESC','By selecting to render a multi-level Joomla! menu inside the user block, you are essentially expanding the editing/navigating options for your users. For example, you can create a menu item with links to add a new blog, product or other item, by using the new \'item form\' menu item in K2 v2.5 or later. See how we use the module in the getk2.org website.','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_k2_user.ini');
INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (7612,'K2_MODERATE_COMMENTS_TO_MY_PUBLISHED_ITEMS','Moderate comments to my published items','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_k2_user.ini');
INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (7613,'K2_MODULE_CLASS_SUFFIX','Module class suffix','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_k2_user.ini');
INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (7614,'K2_MODULE_CLASS_SUFFIX_DESCRIPTION','A suffix to be applied to the CSS class of the Module. This allows for individual Module styling.','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_k2_user.ini');
INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (7615,'K2_MOD_K2_USER_DESCRIPTION','K2 User is a better version of the Joomla! login module. Use it to display a login box for your users. When users are logged in, they see the user block (toolbar), which allows them to perform tasks like: add/edit K2 items (based on their access rights), moderate comments to their items (again, based on their access rights), update their personal details (profile) and quickly access all their published items (the user page/blog). This module replaces the \'K2 Login\' module in v2.5 and later. If you are using the \'K2 Login\' module, please make sure you replace it with this one.','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_k2_user.ini');
