INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (8383,'MOD_NEWS_PRO_GK5_ABOUT_US_CONTENT','<div style=\'color: #555; line-height: 18px; font-size: 12px; padding: 20px 0 0\'><p><strong>Author:</strong></p>News Show Pro GK5 is developed by <a href=\'http://www.gavick.com\' target=\'_blank\' style=\'color: #ef6b09\'>GavickPro</a>. Since 2007 we have been focusing on creating <a href=\'https://www.gavick.com/joomla-templates.html\' target=\'_blank\' style=\'color: #ef6b09\'>Joomla Templates</a> up to the minute in order to fulfill your expectations. Additionally, we provide you with <a href=\'http://www.gavick.com/free-joomla-modules.html\' target=\'_blank\' style=\'color: #ef6b09\'>free extensions</a>, modules and you can also visit our <a href=\'http://www.gavick.com/magazine\' target=\'_blank\' style=\'color: #ef6b09\'>Gavick Blog</a> where it is possible for you to get some useful information connected with services provided and how to avoid some possible problems.<p style=\'font-size: 11px; text-align: center;margin: 60px -10px 0; border-top: 1px solid #eee; padding: 6px 0\'>News Show Pro GK5 is released under the <a href=\'http://www.gnu.org/licenses/gpl-2.0.html\' target=\'_blank\' style=\'color: #ef6b09\'>GNU/GPL v2 license.</a></p>','/home/trevorbi/mycodelicforest.org/public_html/language/en-GB/en-GB.mod_news_pro_gk5.ini');
