INSERT INTO `jos_overrider` (`id`, `constant`, `string`, `file`) VALUES (13111,'T3_TPL_DESC_3','T3 Blank is a blank theme for T3 Framework. With the latest improvements, features and ease of usage, you can now easily adapt it to your site. T3 is way ahead of its predecessors versions viz T3v1 and T3v2. Its more powerful, elegant, user friendly, feature rich and developed to support the latest Joomla 3.0 improvements, don\'t worry T3 is also available for Joomla 2.5 too.','/home/trevorbi/mycodelicforest.org/public_html/templates/t3_blank/language/en-GB/en-GB.tpl_t3_blank.ini');
